import React, { useState, useEffect } from "react";
import axios from "axios";
import KeyboardArrowLeftRoundedIcon from "@mui/icons-material/KeyboardArrowLeftRounded";

function Feeds() {
  const [data, setData] = useState([]);

  useEffect(() => {
    async function fetchData() {
      try {
        const response = await axios.get(
          "https://graph.facebook.comme?fields=first_name,posts{source,type}&access_token=EAAOhcLPfWVkBO9AeXxZCRWn5PHKGTbqG9e17jTaS74hQiudAMPuVWTRZB4BQPEfdRhX3Pk9UplgWSnzwZAG9AcxvMOPn5C7bNkU31zPsmKp8KiXHmBFy5eGQZBrTZAuczDxVWZA2EfodVjM0DokngmN80JNKzjVpgXavNnujB4ROmuWD6vujpcDiDL7wZDZD"
        );
        if (response.data.posts && response.data.posts.data) {
          setData(response.data.posts.data.slice(0, 4));
        }
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    }
    fetchData();
  }, []);

  return (
    <div className="h-[70vh] w-full grid grid-flow-col gap-3 overflow-x-scroll mb-12">
      <div
        className={`h-full md:w-[90px] md:mr-8 w-[100px] text-center flex gap-1 text-gray-700 text-xl md:text-3xl justify-center items-center thermite `}
      >
        <div className="mt-[-8px]">
          <KeyboardArrowLeftRoundedIcon />
        </div>
        VIDEO
      </div>
      {data.length > 0
        ? data.map((e, index) => (
            <div
              key={index}
              className={`h-[70vh] bg-green-200 w-[300px] rounded-md`}
            >
              {console.log("")}
              <video
                className="w-full h-full object-cover rounded-md"
                muted
                controls
                loop
                autoPlay={index === 0 ? true : false}
              >
                <source
                  src={
                    e.type === "video"
                      ? e.source
                      : "https://video.wixstatic.com/video/6587d4_bef08a61503346ea852f4402debea9d6/480p/mp4/file.mp4"
                  }
                  type="video/mp4"
                  preload="metadata"
                />
              </video>
            </div>
          ))
        : [1, 2, 3, 4].map((index) => (
            <div
              key={index}
              className={`h-full bg-green-200 w-[300px] rounded-md`}
            >
              <video
                className="w-full h-full object-cover rounded-md"
                muted
                controls
                loop
                autoPlay={index === 1 ? true : false}
              >
                <source
                  src={
                    "https://video.wixstatic.com/video/6587d4_bef08a61503346ea852f4402debea9d6/480p/mp4/file.mp4"
                  }
                  type="video/mp4"
                  preload="metadata"
                />
              </video>
            </div>
          ))}
    </div>
  );
}

export default Feeds;
